import React from 'react';
import axios from 'axios';

import * as config from "../services/config";
import UserAccountTable from '../components/UserAccountsTable';
import {forEach} from "react-bootstrap/cjs/ElementChildren";

class Main extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            users: [],
            showModal: false,
            startDate: new Date()
        };
    }

    componentDidMount() {
        axios.get(config.userAccountManagementBackendUrl)
            .then(res => {
                this.setState({
                    users: this.cleanUpDates(res.data)
                });

            }).catch((err) => {
            console.log(err)
        });
    }

    cleanUpDates(accounts) {
        return accounts.forEach((a) => {
            let newDate = a.dateOfBirth.split("T")[0];
            a.dateOfBirth = newDate;
        })
    }

    render() {
        const users = this.state.users;
        return (
            <div>
                <UserAccountTable users={users}></UserAccountTable>
            </div>
        )
    }

}

export default Main;
